//获取项目路径
var pathName = window.document.location.pathname;
var projectName = pathName.substring(0, pathName.substr(1).indexOf('/') + 1);

//底部二维码展示
$(function () {
  setTimeout('$(\'[data-toggle=tooltip]\').tooltip();',2000);
});

//通知栏轮播
function jump(){
    $('.tips-bulls li').eq(0).slideUp(2000,function(){
        $(this).clone().appendTo($(this).parent()).show();
        $(this).remove();
    });
}
setInterval('jump()',2000);

//返回顶部
$('.backtop').click(function () {
  $('body,html').animate({scrollTop:0},1000);
  return false;
});

//菜单链接进入active
$(function () {
  var index = window.location.href.split('/').length-1;
  var href = window.location.href.split('/')[index].substr(0,4);
  if(href.length>0){
    //如果匹配开头成功则更改样式
    $('.navbar-nav li a[href^=\''+projectName+'/'+href+'\']').parent().addClass('active');
    //[attribute^=value]：匹配给定的属性是以某些值开始的元素。
  }
});

// 添加Cookie
function addCookie(name, value, options) {
  if (arguments.length > 1 && name != null) {
    if (options == null) {
      options = {};
    }
    if (value == null) {
      options.expires = -1;
    }
    if (typeof options.expires == 'number') {
      var time = options.expires;
      var expires = options.expires = new Date();
      expires.setTime(expires.getTime() + time * 1000);
    }
    if (options.path == null) {
      options.path = '/';
    }
    if (options.domain == null) {
      options.domain = '';
    }
    document.cookie = encodeURIComponent(String(name)) + '=' + encodeURIComponent(String(value)) + (options.expires != null ? '; expires=' + options.expires.toUTCString() : '') + (options.path != '' ? '; path=' + options.path : '') + (options.domain != '' ? '; domain=' + options.domain : '') + (options.secure != null ? '; secure' : '');
  }
}

// 获取Cookie
function getCookie(name) {
  if (name != null) {
    var value = new RegExp('(?:^|; )' + encodeURIComponent(String(name)) + '=([^;]*)').exec(document.cookie);
    return value ? decodeURIComponent(value[1]) : null;
  }
}

// 移除Cookie
function removeCookie(name, options) {
  addCookie(name, null, options);
}

//toastr设置
toastr.options = {
  'closeButton': true,
  'debug': false,
  'progressBar': false,
  'positionClass': 'toast-top-center',
  'showDuration': '400',
  'hideDuration': '1000',
  'timeOut': '4000',
  'extendedTimeOut': '1000',
  'showEasing': 'swing',
  'hideEasing': 'linear',
  'showMethod': 'fadeIn',
  'hideMethod': 'fadeOut'
};

//全局处理ajax函数,返回true则可以继续
function consumeStatus(data) {
  if (data.status==20011){
    toastr.error('用户未登录,5秒后跳转登录页面','FAIL',{
      progressBar:true,
      onHidden:function () {
        window.location.href = projectName+'/login'
      },
      onCloseClick:function () {
        this.onHidden=null;
      }
    })
    return false;
  }else if(data.status!=0){
    if(!data.msg){
      data.msg = '操作失败,请提交bug';
    }
    toastr.warning(data.msg,'WARN!',{
      progressBar:true,
    })
    return false;
  }
  return true;
}
//解析url参数
function GetQueryString(name)
{
  var reg = new RegExp("(^|&)"+ name +"=([^&]*)(&|$)");
  var r = window.location.search.substr(1).match(reg);
  if(r!=null)return  unescape(r[2]); return null;
}
